script: |
  super -f text -I q1576.spq | sort > q1576.out

inputs:
  - name: q1576.spq
    data: |
      SELECT DISTINCT col0 + + col0 FROM tab0 (FORMAT parquet) WHERE + col1 NOT BETWEEN NULL AND - + ( - col1 ) * - ( + col2 ) + + col2;
  - name: tab0

outputs:
  - name: q1576.out
    data: |
      174
      194
      30
